(1, 'Davolio', 'Nancy', 'Representante de Ventas', 'Srta.', '19711208', '20150501', '507 - 20th Ave. E. Apt. 2A', 'Seattle', 'WA', '98122', 'EE.UU.', '(206) 555-9857', '5467', 'La educación incluye una licenciatura en psicología de la Universidad Estatal de Colorado en 1970. También completó "El arte de la llamada en frío". Nancy es miembro de Toastmasters International.', 2, 'http://accweb/emmployees/davolio.bmp'),
(2, 'Fuller', 'Andrew', 'Vicepresidente, Ventas', 'Dr.', '19750219', '20150814', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'EE.UU.', '(206) 555-9482', '3457', 'Andrew recibió su comercial BTS en 1997 y un Ph.D. en marketing internacional de la Universidad de Dallas en 2004. Habla francés e italiano con fluidez y lee alemán. Se incorporó a la empresa como Representante de Ventas, fue ascendido a Gerente de Ventas en enero de 2015 y a vicepresidente de ventas en marzo de 2016. Andrew es miembro de Sales Management Roundtable, la Cámara de Comercio de Seattle y la Asociación Pacific Rim Importers.', NULL, 'http://accweb/emmployees/fuller.bmp'),
(3, 'Leverling', 'Janet', 'Representante de Ventas', 'Srta.', '19860830', '20150401', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'EE.UU.', '(206) 555-3412', '3355', 'Janet tiene una licenciatura en química del Boston College (2007). También completó un programa de certificación en administración de venta minorista de alimentos. Janet fue contratada como Asociado de Ventas en 2014 y ascendida a Representante de Ventas en febrero de 2015.', 2, 'http://accweb/emmployees/leverling.bmp'),
(4, 'Peacock', 'Margaret', 'Representante de Ventas', 'Sra.', '19600919', '20160503', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'EE.UU.', '(206) 555-8122', '5176', 'Margaret tiene una licenciatura en literatura inglesa de Concordia College (1981) y una maestría del Instituto Americano de Artes Culinarias (1989). Fue asignada temporalmente a la oficina de Londres desde julio hasta noviembre de 2015.', 2, 'http://accweb/emmployees/peacock.bmp'),
(5, 'Buchanan', 'Steven', 'Gerente de Ventas', 'Sr.', '19780304', '20161017', '14 Garrett Hill', 'London', NULL, 'SW1 8JR', 'Reino Unido', '(71) 555-4848', '3453', 'Steven Buchanan se graduó de la Universidad de St. Andrews, Escocia, con un título BSC en 1999. Al unirse a la empresa como Representante de Ventas en 2015, pasó 6 meses en un programa de orientación en la oficina de Seattle y luego regresó a su puesto permanente en Londres. Fue ascendido a Gerente de Ventas en marzo de 2016. El Sr. Buchanan ha completado los cursos "Telemarketing Exitoso" y "Administración de Ventas Internacionales". Habla francés con fluidez.', 2, 'http://accweb/emmployees/buchanan.bmp'),
(6, 'Suyama', 'Michael', 'Representante de Ventas', 'Sr.', '19860702', '20161017', 'Coventry House Miner Rd.', 'London', NULL, 'EC2 7JR', 'Reino Unido', '(71) 555-7773', '428', 'Michael se graduó de la Universidad de Sussex (MA, economía, 2006) y de la Universidad de California en Los Ángeles (MBA, marketing, 2009). También ha tomado los cursos "Ventas Multiculturales" y "Gestión del Tiempo para el Profesional de Ventas". Habla japonés con fluidez y puede leer y escribir francés, portugués y español.', 5, 'http://accweb/emmployees/davolio.bmp'),
(7, 'King', 'Robert', 'Representante de Ventas', 'Sr.', '19830529', '20170102', 'Edgeham Hollow Winchester Way', 'London', NULL, 'RG1 9SP', 'Reino Unido', '(71) 555-5598', '465', 'Robert King sirvió en el Cuerpo de Paz y viajó mucho antes de completar su título en inglés en la Universidad de Michigan en 2015, año en que se unió a la empresa. Después de completar un curso titulado "Vender en Europa", fue transferido a la oficina de Londres en marzo de 2016.', 5, 'http://accweb/emmployees/davolio.bmp'),
(8, 'Callahan', 'Laura', 'Coordinador de Ventas Internas', 'Srta.', '19810109', '20170305', '4726 - 11th Ave. N.E.', 'Seattle', 'WA', '98105', 'EE.UU.', '(206) 555-1189', '2344', 'Laura recibió una licenciatura en psicología de la Universidad de Washington. También ha realizado un curso de francés comercial. Ella lee y escribe francés.', 2, 'http://accweb/emmployees/davolio.bmp'),
(9, 'Dodsworth', 'Anne', 'Representante de Ventas', 'Srta.', '19890127', '20171115', '7 Houndstooth Rd.', 'London', NULL, 'WG2 7LT', 'Reino Unido', '(71) 555-4444', '452', 'Anne tiene una licenciatura en inglés de St. Lawrence College. Habla francés y alemán con fluidez.', 5, 'http://accweb/emmployees/davolio.bmp');

